taxon_oid_display_name => sub {
	my $self = shift;

	log_debug { 'self: ' . Dumper $self };

	return csv( in => $self->config->{local_data_dir} . 'dataset.tsv', headers => 'auto', sep_char => "\t", quote_char => undef );

},

location => sub {
	my $self = shift;
	my $aoh = csv( in => $self->config->{local_data_dir} . 'dataset.tsv', headers => 'auto', sep_char => "\t", quote_char => undef );
	return [ grep { $_->{latitude} && $_->{longitude} } @$aoh ];

}

};

sub filter {
	my $self = shift;
	my $data = shift;
	my $filter_h = $self->filters;

	my $f_types = {
		pro => {
			ecosystem_subtype => [ 'Marginal Sea', 'Pelagic' ],
			genome_type => 'isolate',
			genus => 'Prochlorococcus',
			domain => 'Bacteria',
		},

		syn => {
			ecosystem_subtype => [ 'Marginal Sea', 'Pelagic' ],
			genome_type => 'isolate',
			genus => 'Synechococcus',
			domain => 'Bacteria',
		},

		pro_phage => {
		#	ecosystem_subtype => [ 'Marginal Sea', 'Pelagic' ],
			genome_type => 'isolate',
			taxon_display_name => sub { shift =~ m/Prochlorococcus/i ? 1 : 0; },
			domain => 'Viruses',
		},

		syn_phage => {
		#	ecosystem_subtype => [ 'Marginal Sea', 'Pelagic' ],
			genome_type => 'isolate',
			taxon_display_name => sub { shift =~ m/Synechococcus/i ? 1 : 0; },
			domain => 'Viruses',
		},

		metagenome => {
			genome_type => 'metagenome',
			ecosystem_type => 'Marine',
		},

		isolate => {
			genome_type => 'isolate'
		},

		all_proportal => {}

	};

	if ( ! $f_types->{ $filter_h->{pp_subset} } ) {
		die 'Filter ' . $filter_h->{pp_subset} . ' is not defined';
	}

	if ( ! keys %{$f_types->{ $filter_h->{pp_subset} } } ) {
		log_debug { 'Could not find any filters for ' . $filter_h->{pp_subset} };
		return $data;
	}

	my @test;
	for my $k ( keys %{$f_types->{ $filter_h->{pp_subset} }} ) {
		log_debug { 'Looking at ' . $k };
		if ( ! ref $f_types->{ $filter_h->{pp_subset} }{$k} ) {
			push @test, sub {
				my $t = shift;
				say 'looking for '
				. $k . ' to equal '
				. $f_types->{ $filter_h->{pp_subset} }{$k}
				. '; it is ' . $t->{$k};

				return 1 if ! exists $t->{ $k };

				say 'test: ' . $f_types->{ $filter_h->{pp_subset} }{$k}
				. ' equal to ' . $t->{$k} . ': '
				. ( $f_types->{ $filter_h->{pp_subset} }{$k} eq $t->{$k} ) ;
				return $f_types->{ $filter_h->{pp_subset} }{$k} eq $t->{$k} ? 1 : 0;
			};
		}
		elsif ( 'ARRAY' eq ref $f_types->{ $filter_h->{pp_subset} }{$k} ) {
			push @test, sub {
				my $t = shift;
				log_debug { 'looking for ' . $k . ' to be one of: ' . join ", ", @{$f_types->{ $filter_h->{pp_subset} }{$k}} };
				return 1 if ! exists $t->{ $k };
				return scalar grep { $t->{$k} eq $_ } @{$f_types->{ $filter_h->{pp_subset} }{$k}};
			};
		}
		elsif ( 'CODE' eq ref $f_types->{ $filter_h->{pp_subset} }{$k} ) {
			push @test, $f_types->{ $filter_h->{pp_subset} }{$k};
		}
	}

	log_debug { 'test array: ' . Dumper \@test };

	my @passed;
	DATA_LOOP:
	for my $d ( @$data ) {
		log_debug { 'looking at data item for ' . $d->{taxon_oid} };
		for my $t ( @test ) {
			log_debug { 'Running test' };
			my $ans = $t->( $d );
			log_debug { 'answer: ' . Dumper $ans };
			if ( ! $t->( $d ) ) {
				log_debug { $d->{taxon_oid} . ' failed test: ' . Dumper $t };
				next DATA_LOOP;
			}
#			next DATA_LOOP unless $_->( $d );
		}
		push @passed, $d;
	}
	return \@passed;
}

around run_query => sub {
    my $orig = shift;
	my $self = shift;

	my $args;
	if ( @_ && 1 < scalar( @_ ) ) {
		$args = { @_ } ;
	}
	else {
		$args = shift;
	}

	#	query is the name of the method to run
	#	args->{params} will contain filter params

	my $query = $args->{query}
		# no query specified
		or croak __PACKAGE__ . ' ' . (caller(0))[3]
		. ': no query specified!';

	if (! $self->can($query)) {
		croak __PACKAGE__ . ' ' . (caller(0))[3]
		. ': no query named ' . $query . ' exists!';
	}

	# add filters
	my $data = $self->$query;
	if ( $self->filters ) {
		return $self->filter( $data );
	}
	return $data;
};




